import React from "react";
import ReactDOM from "react-dom";
import MainComponent from "./components/MainComponent";

const App = () => (
  <ApolloProvider client={client}>
    <MainComponent />
  </ApolloProvider>
);

ReactDOM.render(<App />, document.getElementById("root"));
